import { Link } from 'react-router-dom'

import '../../styles/navBarStyle.css';

export const NavBar = () => {

  return (

    <div className = 'homeOption'>

        <Link className = 'homeOptionsStyle myRoutes' to='/home'> Mis rutas </Link>

        <Link className = 'homeOptionsStyle newRoute' to='/newRoute'> Agregar nueva ruta </Link>

        <Link className = 'homeOptionsStyle completed' to='/completed'> Rutas completadas </Link>

        <Link className = 'homeOptionsStyle trash'> Papelera </Link>
   
    </div>

  )
}
